$("#registerBtn").click(function(){console.log(111);var a=$("#uname").val();var b=$("#upwd").val();$.ajax({type:"post",url:"data/register.php",data:{uname:a,upwd:b},success:function(c){console.log(c);if(c.msg=="error"){alert("用户信息已被注册")}else{alert("注册成功,3秒钟自动跳转到登录页");setTimeout(function(){location.href="login.html"},3000)}}})});